def check_ze_impacte_fu():
    eb_max_dist = get_param_value("eb_max_dist")
    list_zc = get_all_zc()
    results = {zc_name: dict() for zc_name in list_zc}
    vb_dict = load_sheet(DCSYS.CV)
    maz_dict = load_sheet(DCSYS.Zaum)
    vb_per_zc = {zc_name: sorted([vb_name for vb_name in vb_dict if zc_name in get_zc_of_obj(DCSYS.CV, vb_name)])
                 for zc_name in list_zc}
    maz_per_zc = {zc_name: sorted([maz_name for maz_name in maz_dict if zc_name in get_zc_of_obj(DCSYS.Zaum, maz_name)])
                  for zc_name in list_zc}

    for zc_name in list_zc:
        for vb_name in vb_per_zc[zc_name]:
            cv_ze_impacte_fu = list()
            for maz_index, maz_name in enumerate(maz_per_zc[zc_name], start=1):
                downstream_dist = get_dist_between_objects(DCSYS.CV, vb_name, DCSYS.Zaum, maz_name, downstream=True,
                                                           avoid_zero=True)
                if downstream_dist is not None and 0 < downstream_dist <= eb_max_dist:
                    cv_ze_impacte_fu.append((maz_name, maz_index, "CROISSANT"))

                upstream_dist = get_dist_between_objects(DCSYS.CV, vb_name, DCSYS.Zaum, maz_name, downstream=False,
                                                         avoid_zero=True)
                if upstream_dist is not None and 0 < upstream_dist <= eb_max_dist:
                    cv_ze_impacte_fu.append((maz_name, maz_index, "DECROISSANT"))
            results[zc_name][vb_name] = list(zip(*cv_ze_impacte_fu))

    # pretty_print_dict(results)

    # print("\n")
    for zc_name, zc_info in [("ZC_03", ZC_03), ("ZC_04", ZC_04)]:
        for line in zc_info.splitlines():
            vb_name, maz_names, maz_ids, directions = line.split("\t")
            maz_names_str = tuple(maz_name.removeprefix("ZE_") for maz_name in maz_names.split(";"))
            maz_id_str = tuple(int(maz_id) for maz_id in maz_ids.split(";"))
            directions_str = tuple(direction for direction in directions.split(";"))
            compare_cv_ze_impacte_fu = results[zc_name][vb_name]
            if not maz_names_str == compare_cv_ze_impacte_fu[0]:
                print_error(f"In {zc_name} for {vb_name}:\n{maz_names_str=}\n{compare_cv_ze_impacte_fu[0]=}")
            if not maz_id_str == compare_cv_ze_impacte_fu[1]:
                print_error(f"In {zc_name} for {vb_name}:\n{maz_id_str=}\n{compare_cv_ze_impacte_fu[1]=}")
            if not directions_str == compare_cv_ze_impacte_fu[2]:
                print_error(f"In {zc_name} for {vb_name}:\n{maz_names_str=}\n{compare_cv_ze_impacte_fu[2]=}")
